import React from 'react';
import StarFilled from '../../assets/star-filled.png'; 
import StarEmpty from '../../assets/star-empty.png'; 
import locations from '../../locations.json';
import { useParams } from 'react-router-dom';
import './RatingStars.css';

const RatingStars = () => {
    const { id } = useParams(); // Get the id from the URL
    const location = locations.find(location => location.id === id); // Find the location by id
    
    if (!location || !location.rating) {
        return null; // Return null if location is not found or if rating is not available
    }

    const rating = parseInt(location.rating); // Convert rating to integer

    const starArray = []; // Create an empty array to store the star images

    for (let i = 1; i <= 5; i++) {
        const starSrc = i <= rating ? StarFilled : StarEmpty; // Use StarFilled if i is less than or equal to rating, otherwise use StarEmpty
        starArray.push(<img key={i} src={starSrc} alt="star" className="star" />); // Add the star image to the array
    }

    return (
        <div className="rating__stars">
            {starArray}
        </div>
    );
};

export default RatingStars;
